// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MDCNCoordination {
    struct IntelMessage {
        uint256 id;
        address sender;
        address recipient; // The intended receiver
        string intelData;
        uint256 timestamp;
        bool acknowledged;
        address acknowledgedBy;
        uint256 acknowledgedTimestamp;
    }
    uint256 public intelCount;
    mapping(uint256 => IntelMessage) public intelStore;

    event IntelligenceSynced(
        uint256 indexed id,
        address indexed sender,
        address indexed recipient,
        string data,
        uint256 timestamp
    );

    event IntelligenceAcknowledged(
        uint256 indexed id,
        address indexed acknowledgedBy,
        uint256 timestamp
    );

    // For backward compatibility with the old frontend
    // Sync new intelligence with a specified recipient group and branch
    function syncIntelligence(
        uint8 _recipientGroup,
        uint8 _branch,
        string memory _data
    ) public {
        intelCount++;

        // For the legacy version, we don't know the exact recipient,
        // so we use a placeholder address
        address dummyRecipient = address(
            0x1234567890123456789012345678901234567890
        );

        intelStore[intelCount] = IntelMessage({
            id: intelCount,
            sender: msg.sender,
            recipient: dummyRecipient,
            intelData: _data,
            timestamp: block.timestamp,
            acknowledged: false,
            acknowledgedBy: address(0),
            acknowledgedTimestamp: 0
        });

        emit IntelligenceSynced(
            intelCount,
            msg.sender,
            dummyRecipient,
            _data,
            block.timestamp
        );
    }

    // New version with direct addressing
    // Sync new intelligence with a specified recipient address
    function syncIntelligence(address _recipient, string memory _data) public {
        intelCount++;
        intelStore[intelCount] = IntelMessage({
            id: intelCount,
            sender: msg.sender,
            recipient: _recipient,
            intelData: _data,
            timestamp: block.timestamp,
            acknowledged: false,
            acknowledgedBy: address(0),
            acknowledgedTimestamp: 0
        });

        emit IntelligenceSynced(
            intelCount,
            msg.sender,
            _recipient,
            _data,
            block.timestamp
        );
    }

    // Acknowledge receipt of the intelligence
    function acknowledgeIntelligence(uint256 _intelId) public {
        IntelMessage storage intel = intelStore[_intelId];
        require(intel.id != 0, "Intel not found");
        require(!intel.acknowledged, "Already acknowledged");

        // In legacy mode, we may not know the exact recipient, so we relax this check
        // but we still enforce it for newer entries
        if (
            intel.recipient !=
            address(0x1234567890123456789012345678901234567890)
        ) {
            require(msg.sender == intel.recipient, "Not the recipient");
        }

        intel.acknowledged = true;
        intel.acknowledgedBy = msg.sender;
        intel.acknowledgedTimestamp = block.timestamp;

        emit IntelligenceAcknowledged(_intelId, msg.sender, block.timestamp);
    }
}

